    public static void main (String[] args) throws IOException
    {
        String[]  customArgs = { "--root", "-d", "test_list_db_frame_size", "--fs", "32768" };
        final int customCount = customArgs.length;
        customArgs = Arrays.copyOf(customArgs, customCount + args.length);
        for (int i = 0; i < args.length; ++i)
            customArgs[customCount + i] = args[i];

        CommnandLine cmdLine = new CommnandLine (customArgs);
        Connection c = new Connection (cmdLine.getHostname (),
                                       cmdLine.getPort (),
                                       cmdLine.getDatabase (),
                                       cmdLine.getPassword (),
                                       (byte) cmdLine.getUserId (),
                                       cmdLine.getMaxFrameSize ());

        ConnectorTestListGlobals testListGlobas = new ConnectorTestListGlobals ();

        boolean testResult = testListGlobas.checkGlobalsName (c);
        testResult = testResult && testListGlobas.checkGlobalsTypes (c);

        c.close ();

        if ( ! testResult) {
            System.out.println ("TEST RESULT: FAIL");
            System.exit (1);
        }

        System.out.println ("TEST RESULT: PASS");
    }

    private boolean checkGlobalsName (Connection c) throws IOException
    {
        final String[] globals = c.retrieveGlobalNames ();

        for (int i = 0; i < globals.length; ++i) {
            for (int j = i + 1; j < globals.length; ++j) {
                if (globals[i].equals (globals[j])) {
                    System.out.println ("Retieved a global name twice.");
                    return false;
                }
            }

            int found = -1;
            for (int j = 0; j < this.mGlobalsList.length; ++j) {
                if (globals[i].equals(this.mGlobalsList[j])) {
                    found = j;
                    break;
                }
            }

            if (found < 0) {
                System.out.println ("Retrieved an unepxected global name '" + globals[i] + "'.");
                return false;
            }
        }

        if (globals.length != this.mGlobalsList.length) {
            System.out.println ("Retrieved " + globals.length + "instead of " + this.mGlobalsList.length + '.');
            return false;
        } else {
            System.out.println ("Retrieved " + globals.length + " globals.");
        }

        System.out.println ("Retrieved expected globals.");
        return true;
    }

    private boolean checkGlobalsTypes (Connection c) throws IOException
    {
        for (int i = 0; i < this.mGlobalsList.length; ++i) {
            if ( ! this.checkGlobalType (c, i)) {
                System.out.println ("Failed to match type global '" + this.mGlobalsList[i] + "', index " + i + '.');
                return false;
            }
        }

        return true;
    }

    private boolean checkGlobalType (Connection c, int glbIndex) throws IOException {
        ValueType type = c.describeGlobal (this.mGlobalsList[glbIndex]);
        String tstring = type.toString ();

        if ( ! type.isTable ())
            return tstring.equals (this.mGlobalsTypes[glbIndex]);

        int fieldsCount = 0;
        for (int i = 0; i < tstring.length (); ++i) {
            final char p = tstring.charAt (i);

            if ((p == ',') || (p == '('))
                ++fieldsCount;
        }

        TableFieldType[] fields = type.getFields ();
        if (fieldsCount == 0)
        {
            if (fields.length != 0)
                return false;

            return tstring.equals (this.mGlobalsTypes[glbIndex]);
        }
        else if (tstring.indexOf("TABLE OF (") != 0)
            return false;

        if (fieldsCount != fields.length) {
            System.out.println ("Unexpected fields count " + fieldsCount + " vs. " + fields.length);
            return false;
        }

        int[] fieldsOffsets = new int[fieldsCount];
        for (int field = 0; field < fields.length; ++field) {
            String fstring = fields[field].toString ();
            if ((fieldsOffsets[field] = this.mGlobalsTypes[glbIndex].indexOf(fstring)) < 0) {
                System.out.println ("Cannot find fields subtring '" + fstring + "'.");
                return false;
            }

            for (int i = 0; i < field; ++i) {
                if (fieldsOffsets[i] == fieldsOffsets[field]) {
                    System.out.println ("Field '" + fields[field].getName () + "' retrived twice.");
                    return false;
                }
            }
        }

        return true;
    }

